      <div className='login-form'>
        <input type={'text'} placeholder={'Your Email'} />
        <input type={'password'} placeholder={'Your Password'} />
        <input type={'submit'} value={'SUBMIT'} />
      </div>
      <p>Forgot your password?</p>
    </div>
  );
};
